      "additionalInformationFromClient": "[{\"type\":\"p\",\"children\":[{\"text\":\"4/17/2024\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"Below is the customers installers responses.\\n\\n1. See the attached red-line drawing.\\n2. What was used is 1-1/2\\\"x1-1/2\\\" slotted angle iron bolted to the bottom of the panel with (x2) 3/8\\\"x1\\\" nuts and bolts and then that angle iron is bolted to another (x2) 1-1/2\\\"x1-1/2\\\" slotted angle iron that is then used to screw the panel down to the roof. Screwing down to the roof is done with 3\\\" rubber washered roof screws that are going into the decking through the metal roof. There are 8-10 roof screws per panel. See the attached photos of the bottom of a panel.\\n\"}]},{\"type\":\"p\",\"children\":[{\"text\":\" \"},{\"type\":\"a\",\"url\":\"https://app.greenlancer.com/uploads/661ff45510af4978431187.pdf?filename=Steve+Mark+Schematic_R.1.+-+16-Apr-24.pdf\",\"target\":\"_blank\",\"children\":[{\"text\":\"Steve Mark Schematic_R.1. - 16-Apr-24.pdf\"}]},{\"text\":\"\\n \"},{\"type\":\"a\",\"url\":\"https://app.greenlancer.com/uploads/661ff455149f0846114239.pdf?filename=Steve+Mark+PV+Panel+Mounting+Bottom+Side.pdf\",\"target\":\"_blank\",\"children\":[{\"text\":\"Steve Mark PV Panel Mounting Bottom Side.pdf\"}]},{\"text\":\"\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"(Files uploaded in the job folder)\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"----------------------------------\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"4/10/24 \"}]},{\"type\":\"p\",\"children\":[{\"text\":\"Below is the information requested and images. Please let me know if you need more information.\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"1) Panels are attached to what looks like 2”x2” angle iron. Using ⅜” diameter bolts to bolt the panels to the angle. The angle iron is secured to the roof using multiple metal roofing screw on the tops of the ribs. I cannot distinguish if the screws are only into the metal or if they are long enough to go into the decking as well. By looking at all the metal roof installation, all screws are on top of the ribs so that makes me want to say that everything is screwed into the decking.\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"2) The main breaker panel has (x2) 30amp 2-pole breakers for his a/c units. Everything else is just 20amp for receptacle circuits and 15amps for lighting and smoke detection circuits.\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"3) the panel is rated for 225amps max.\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"Also, On the electrical schematic. Please incorporate into the drawings a 48vDC-12vDC converter. This must be used to send the signal and charge the battery for the backup generator.\\n\\nThe converter I have is the following:\\nMake: Mean Well\\nModel: DDR-120C-12\\nRated Power: 120watts\\nRated Current: 10amps\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"-------------------------------------------------------\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"the customer also request Placards, Labels & Safety Stickers for the Solar Inspection Requirements. \"}]},{\"type\":\"p\",\"children\":[{\"text\":\"IMPORTANT Customer Preferences\\tCustomer has Canadian solar 300W solar panels but I cannot connect the PDF for some reason.\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"Project Manager's Phone Number\\t17572629034\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"Structure 1 member size\\tUnsure of the roof size\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"Structure 1 member spacing\\t*\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"Structure 1 member span\\t*\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"Project Notes & Special Requirements\\tProducts the customer:\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"12 x EG4 LL-S Server rack battery - 100ah 48V\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"2 x Sol Ark 15k\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"33 x 300W Canadian Solar panels\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"33 x AP Systems Rapid Shutoff device [RSD-S-PLC(MC4)] | SKU: RSD-S-PLC(MC4)\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"3 x 20amp inline fuse for solar panels\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"1 x Single Core Transmitter-PLC-Outdoor Kit, 180-550VAC Power Supply\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"1 x IMO Emergency Stop Station | Emergency Stop Station 40mm Twist To Release Red Button, Yellow Top Enclosure 1NO + 1NC Contacts\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"2 x Blue Sea Systems PowerBar 1000 | 1000A Multiple Stud Busbar (8 stud, 5/16)\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"2 x 4/0AWG Copper Cabling | Pick Length and Lugs | 3ft / 5/16\\\"-5/16\\\" / Set\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"2 x 4/0AWG Copper Cabling | Pick Length and Lugs | 5ft / 5/16\\\"-5/16\\\" / Set\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"2 x PV DC Quick Disconnect Switch | 1000V 64 Amps | DC1600V32A2IO | Solar Panel Quick Disconnect SKU: DC1600V32A2IO\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"2 x Bus Bar Pair for Sol-Ark 15K SKU: SOL-ARK-BUS-BAR\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"1 x Rich Solar 5-Pack of PV Connectors for solar panel PV wiring | SKU: RS-SC5P\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"1 x 2 x 500 Ft. PV Reel Kit (Red & Black) + PV Connector Ends | 1,000 Ft. PV Extension Wire 600V | Includes PV Connector Ends | 8 AWG\"}]},{\"type\":\"p\",\"children\":[{\"text\":\"Verify How many Roof Structures\\t1 Roof Structure\"}]}]",
